import Nav from "./Nav";
import Head from "next/head";

const Layout = (props) => (
  <div>
    <Head>
      {/* 變成網頁頁籤 */}
      <title>I am on top</title>
    </Head>
    <Nav />
    {props.children}
  </div>
);
export default Layout;
